import Header from "./Header";
import Footer from "./Footer";
import HeadTag from "./HeadTag";
import NavBar from "./NavBar";
import "../asset/fonts/fonts.scss";

const withLayout = Page => {
  return () => (
    <>
      <HeadTag />
      <Header />
      <NavBar />
      <Page />
      <Footer />
    </>
  );
}

export default withLayout;
